import "core-js/modules/es.array.push.js";
import axios from 'axios';
export default {
  props: {
    registrationId: {
      type: Number,
      required: true
    }
  },
  data() {
    return {
      address: {
        street: '',
        city: '',
        state: ''
      }
    };
  },
  methods: {
    submitAddress() {
      axios.post('/addresses', {
        ...this.address,
        registration_id: this.registrationId
      }).then(() => {
        this.$router.push({
          name: 'SearchPage'
        });
        this.$emit('update');
      }).catch(error => {
        console.error('Erro ao adicionar endereço:', error.response.data.message);
      });
    }
  }
};
